import React, { Component } from "react";

export default class Cart extends Component {
  render() {
    return (
      <div>
        <div className="row">
          <div className="col-md-12 ">
            <p className="h4">My Food Bag</p>
          </div>
        </div>
        <div className="row">
          <div className="col-md-8 "></div>
          <div className="col-md-4 "></div>
        </div>
      </div>
    );
  }
}
